import React, { Component } from 'react';

export class LongIsland extends Component {
  render() {
    return (
      <div>
        <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/c0/Long_Island_Landsat_Mosaic.jpg/1024px-Long_Island_Landsat_Mosaic.jpg" alt="Long Island"></img>
      </div>
    )
  }
};

export default LongIsland;
